import React, { useRef } from "react";
import emailjs from "@emailjs/browser";
import "./Home.css";

const Home = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        "service_qompota",
        "template_95iekz2",
        form.current,
        "tkG-UJe02yYKmGQ-m"
      )
      .then(
        (result) => {
          console.log(result.text);
          alert("✅ Subscription successful! Thank you.");
          form.current.reset();
        },
        (error) => {
          console.log(error.text);
          alert("❌ Something went wrong. Please try again.");
        }
      );
  };

  return (
    <div className="home-container">
      {/* ===== Hero Section ===== */}
      <section className="hero-section">
        <div className="hero-text">
          <h1>The Live Shopping Marketplace</h1>
          <p>Shop, sell, and connect around the things you love.</p>
          <button>Shop Now</button>
        </div>
        <div className="hero-image">
          <img src="assets/Hero.png" alt="Live Shopping" />
        </div>
      </section>

      {/* ===== Features Section ===== */}
      <section className="feature-section">
        <div className="feature-image">
          <img src="assets/Hero2.jpeg" alt="Join the Fun" />
        </div>
        <div className="feature-text">
          <h2>Join In the Fun</h2>
          <p>
            Take part in fast-paced auctions, flash sales, live show giveaways, 
            and more.
          </p>
          <button>Shop Now</button>
        </div>
      </section>

      {/* ===== Products Section ===== */}
      <section className="products-section">
        <div className="products-text">
          <h2>We've Got It All</h2>
          <p>
            Explore 250+ categories including fashion, collectibles, sneakers, 
            and more.
          </p>
          <button>Shop Now</button>
        </div>
        <div className="products-image">
          <img src="assets/c425.jpeg" alt="Products" />
        </div>
      </section>

      {/* ===== Deals Section ===== */}
      <section className="deals-section">
        <div className="deals-text">
          <h2>Find Incredible Deals on Name Brands</h2>
          <p>
            From the brands you love to specialty products, discover amazing 
            deals every day.
          </p>
          <button>Shop Now</button>
        </div>
        <div className="deals-image">
          <img src="assets/images.png.png" alt="Deals" />
        </div>
      </section>

      {/* ===== Subscribe Section ===== */}
      <section className="subscribe-section">
        <h2>Subscribe to Our Newsletter</h2>
        <p>Stay updated with the latest deals, offers, and live shopping events!</p>
        <form ref={form} onSubmit={sendEmail} className="subscribe-form">
          <input type="email" name="user_email" placeholder="Enter your email" required />
          <button type="submit">Subscribe</button>
        </form>
      </section>
    </div>
  );
};

export default Home;
